      "headersStr": "heroImage actionText actionLink subActionText subActionLink features sponsors sponsorsText",
      "content": "# Config: Home\n\nThe following are all the frontmatter configurations for the homepage.\n\n\n# heroImage\n\n * Type: string\n * Default: undefined\n\nTIP\n\nIn VT, for the style of the homepage, we do not recommend that you use this config, and this config is kept only for compatibility with VuePress's Default Theme Config,\n\nConfig hero image.\n\n---\nheroImage: /logo.svg\n---\n\n\n\n# actionText\n\n * Type: string\n * Default: undefined\n\nMain action button's text\n\n---\nactionText: Getting Started\n---\n\n\n\n# actionLink\n\n * Type: string\n * Default: undefined\n\nMain action button's link\n\n---\nactionLink: /guide/\n---\n\n\n\n# subActionText\n\n * Type: string\n * Default: undefined\n\nSub action button's text\n\n---\nsubActionText: Install\n---\n\n\n\n# subActionLink\n\n * Type: string\n * Default: undefined\n\nSub action button's text\n\n---\nsubActionLink: /guide/getting-started.html\n---\n\n\n\n# features\n\n * Type: array\n * Default: undefined\n\nFeatures configurations, it's better to set three or six items:\n\n---\nfeatures:\n  - title: Full-text search\n    details: Full-text search is supported by default, no server dependency, distinguishing locales.\n  - title: Out of the box\n    details: Compatible with VuePress' default theme, built-in common documentation features, e.g. i18n, Code Copy, TOC.\n  - title: TypeScript\n    details: It's easier to custom your own config with full TypeScript support.\n---\n\n\n\n# sponsors\n\n * Type: array\n * Default: undefined\n\n---\nsponsors:\n  - title: n8n.io\n    img: https://avatars.githubusercontent.com/u/45487711?s=200&v=4\n    link: https://n8n.io/\n---\n\n\n\n# sponsorsText\n\n * Type: array\n * Default: 'Special Sponsor'\n\nSponsor's intro text.",
      "normalizedContent": "# config: home\n\nthe following are all the frontmatter configurations for the homepage.\n\n\n# heroimage\n\n * type: string\n * default: undefined\n\ntip\n\nin vt, for the style of the homepage, we do not recommend that you use this config, and this config is kept only for compatibility with vuepress's default theme config,\n\nconfig hero image.\n\n---\nheroimage: /logo.svg\n---\n\n\n\n# actiontext\n\n * type: string\n * default: undefined\n\nmain action button's text\n\n---\nactiontext: getting started\n---\n\n\n\n# actionlink\n\n * type: string\n * default: undefined\n\nmain action button's link\n\n---\nactionlink: /guide/\n---\n\n\n\n# subactiontext\n\n * type: string\n * default: undefined\n\nsub action button's text\n\n---\nsubactiontext: install\n---\n\n\n\n# subactionlink\n\n * type: string\n * default: undefined\n\nsub action button's text\n\n---\nsubactionlink: /guide/getting-started.html\n---\n\n\n\n# features\n\n * type: array\n * default: undefined\n\nfeatures configurations, it's better to set three or six items:\n\n---\nfeatures:\n  - title: full-text search\n    details: full-text search is supported by default, no server dependency, distinguishing locales.\n  - title: out of the box\n    details: compatible with vuepress' default theme, built-in common documentation features, e.g. i18n, code copy, toc.\n  - title: typescript\n    details: it's easier to custom your own config with full typescript support.\n---\n\n\n\n# sponsors\n\n * type: array\n * default: undefined\n\n---\nsponsors:\n  - title: n8n.io\n    img: https://avatars.githubusercontent.com/u/45487711?s=200&v=4\n    link: https://n8n.io/\n---\n\n\n\n# sponsorstext\n\n * type: array\n * default: 'special sponsor'\n\nsponsor's intro text.",
