      "headersStr": "home api toc sidebar sidebarDepth navbar pageEdit",
      "content": "# Config: Frontmatter\n\n\n# home\n\n * Type: boolean\n * Default: false\n\nDeclare that current page is homepage:\n\n---\nhome: true\n---\n\n\nFor more details please head Guide > Homepage.\n\n\n# api\n\n * Type: boolean\n * Default: false\n\nDeclare that current page is api page:\n\n---\napi: true\n---\n\n\nFor more details please head Guide > API Page.\n\n\n# toc\n\n * Type: boolean\n * Default: true\n\nDisplay table of content at right side, set false to hidden it:\n\n---\ntoc: false\n---\n\n\n\n# sidebar\n\n * Type: boolean\n * Default: true\n\nDisplay current sidebar at left side, set false to hidden sidebar:\n\n---\nsidebar: false\n---\n\n\nSee live example.\n\n\n# sidebarDepth\n\n * Type: number\n * Default: 1\n\nSet maximum depth of sidebar headers, set 0 to hide headers at it:\n\n\n\n\n\n# navbar\n\n * Type: boolean\n * Default: true\n\nDisplay current navbar at the top, set false to hidden it:\n\n---\nnavbar: false\n---\n\n\n\n# pageEdit\n\nDisplay page edit at the bottom, set false to hidden it:\n\n---\npageEdit: false\n---\n",
      "normalizedContent": "# config: frontmatter\n\n\n# home\n\n * type: boolean\n * default: false\n\ndeclare that current page is homepage:\n\n---\nhome: true\n---\n\n\nfor more details please head guide > homepage.\n\n\n# api\n\n * type: boolean\n * default: false\n\ndeclare that current page is api page:\n\n---\napi: true\n---\n\n\nfor more details please head guide > api page.\n\n\n# toc\n\n * type: boolean\n * default: true\n\ndisplay table of content at right side, set false to hidden it:\n\n---\ntoc: false\n---\n\n\n\n# sidebar\n\n * type: boolean\n * default: true\n\ndisplay current sidebar at left side, set false to hidden sidebar:\n\n---\nsidebar: false\n---\n\n\nsee live example.\n\n\n# sidebardepth\n\n * type: number\n * default: 1\n\nset maximum depth of sidebar headers, set 0 to hide headers at it:\n\n\n\n\n\n# navbar\n\n * type: boolean\n * default: true\n\ndisplay current navbar at the top, set false to hidden it:\n\n---\nnavbar: false\n---\n\n\n\n# pageedit\n\ndisplay page edit at the bottom, set false to hidden it:\n\n---\npageedit: false\n---\n",
