      "headersStr": "Quick Start Custom Groups Define Groups Using Groups",
      "content": "# Code Switcher\n\nTIP\n\nInspired by vuepress-plugin-code-switcher.\n\n\n# Quick Start\n\n * Input\n\n<CodeSwitcher :languages=\"{ js: 'JavaScript', ts: 'TypeScript' }\">\n<template v-slot:js>\n\n```js\nmodule.exports = function (str) {\n  return typeof str === \"string\" && str.trim() === str;\n};\n```\n\n</template>\n<template v-slot:ts>\n\n```ts\nexport default function isString(str: string): str is string {\n  return typeof str === \"string\" && str.trim() === str;\n}\n```\n\n</template>\n</CodeSwitcher>\n\n\n * Output:\n\nmodule.exports = function (str) {\n  return typeof str === \"string\" && str.trim() === str;\n};\n\n\nexport default function isString(str: string): str is string {\n  return typeof str === \"string\" && str.trim() === str;\n}\n\n\n\n# Custom Groups\n\n\n# Define Groups\n\n// .vuepress/config.ts\nimport { ThemeConfig } from \"vuepress-theme-vt\";\nimport { defineConfig4CustomTheme } from \"vuepress/config\";\n\nexport = defineConfig4CustomTheme<ThemeConfig>({\n  theme: \"vt\",\n  themeConfig: {\n    codeSwitcher: {\n      groups: {\n        default: { ts: \"TypeScript\", js: \"JavaScript\" },\n        \"plugin-usage\": { tuple: \"Tuple\", object: \"Object\" },\n      },\n    },\n  },\n});\n\n\n\n# Using Groups\n\n * Input:\n\n<CodeSwitcher name=\"plugin-usage\">\n<template v-slot:tuple>\n\n```ts\nmodule.exports = {\n  plugins: [\n    [\n      \"vuepress-plugin-xxx\",\n      {\n        /* options */\n      },\n    ],\n  ],\n};\n```\n\n</template>\n<template v-slot:object>\n\n```ts\nmodule.exports = {\n  plugins: {\n    xxx: {\n      /* options */\n    },\n  },\n};\n```\n\n</template>\n</CodeSwitcher>\n\n\n * Output:\n\nmodule.exports = {\n  plugins: [\n    [\n      \"foo\",\n      {\n        /* options */\n      },\n    ],\n  ],\n};\n\n\nmodule.exports = {\n  plugins: {\n    foo: {\n      /* options */\n    },\n  },\n};\n",
      "normalizedContent": "# code switcher\n\ntip\n\ninspired by vuepress-plugin-code-switcher.\n\n\n# quick start\n\n * input\n\n<codeswitcher :languages=\"{ js: 'javascript', ts: 'typescript' }\">\n<template v-slot:js>\n\n```js\nmodule.exports = function (str) {\n  return typeof str === \"string\" && str.trim() === str;\n};\n```\n\n</template>\n<template v-slot:ts>\n\n```ts\nexport default function isstring(str: string): str is string {\n  return typeof str === \"string\" && str.trim() === str;\n}\n```\n\n</template>\n</codeswitcher>\n\n\n * output:\n\nmodule.exports = function (str) {\n  return typeof str === \"string\" && str.trim() === str;\n};\n\n\nexport default function isstring(str: string): str is string {\n  return typeof str === \"string\" && str.trim() === str;\n}\n\n\n\n# custom groups\n\n\n# define groups\n\n// .vuepress/config.ts\nimport { themeconfig } from \"vuepress-theme-vt\";\nimport { defineconfig4customtheme } from \"vuepress/config\";\n\nexport = defineconfig4customtheme<themeconfig>({\n  theme: \"vt\",\n  themeconfig: {\n    codeswitcher: {\n      groups: {\n        default: { ts: \"typescript\", js: \"javascript\" },\n        \"plugin-usage\": { tuple: \"tuple\", object: \"object\" },\n      },\n    },\n  },\n});\n\n\n\n# using groups\n\n * input:\n\n<codeswitcher name=\"plugin-usage\">\n<template v-slot:tuple>\n\n```ts\nmodule.exports = {\n  plugins: [\n    [\n      \"vuepress-plugin-xxx\",\n      {\n        /* options */\n      },\n    ],\n  ],\n};\n```\n\n</template>\n<template v-slot:object>\n\n```ts\nmodule.exports = {\n  plugins: {\n    xxx: {\n      /* options */\n    },\n  },\n};\n```\n\n</template>\n</codeswitcher>\n\n\n * output:\n\nmodule.exports = {\n  plugins: [\n    [\n      \"foo\",\n      {\n        /* options */\n      },\n    ],\n  ],\n};\n\n\nmodule.exports = {\n  plugins: {\n    foo: {\n      /* options */\n    },\n  },\n};\n",
