      "headersStr": "Motivation Features Next Step",
      "content": "# Introduction\n\n\n# Motivation\n\nNext Vue's documentation is very cool, which is built by @vue/theme and VitePress â€”â€” A next-generation SSG for Vue ecosystem, but currently VitePress is still in early stage and there is no plugin system.\n\nI made this theme to combine eXperience of @vue/theme and current huge VuePress ecosystem, also introducing some built-in features like full-text search, i18n etc.\n\n\n# Features\n\n * Compatibility: fully compatible with VuePress's Default Theme.\n * Full-text search: No server dependencies, distinguishing locales.\n * Dark Mode\n * TypeScript Support\n * Homepage\n * API Page\n * i18n, Code Copy, TOC, etc.\n * ...\n\n\n# Next Step",
      "normalizedContent": "# introduction\n\n\n# motivation\n\nnext vue's documentation is very cool, which is built by @vue/theme and vitepress â€”â€” a next-generation ssg for vue ecosystem, but currently vitepress is still in early stage and there is no plugin system.\n\ni made this theme to combine experience of @vue/theme and current huge vuepress ecosystem, also introducing some built-in features like full-text search, i18n etc.\n\n\n# features\n\n * compatibility: fully compatible with vuepress's default theme.\n * full-text search: no server dependencies, distinguishing locales.\n * dark mode\n * typescript support\n * homepage\n * api page\n * i18n, code copy, toc, etc.\n * ...\n\n\n# next step",
