      "headersStr": "Migrate from default theme Migrate from other themes",
      "content": "# Migration\n\n\n# Migrate from default theme\n\nSince VT is fully compatible with VuePress's Default Theme, migrating from default theme to VT is very easy:\n\n // .vuepress/config.js\n module.exports = {\n+  theme: 'vt',\n   themeConfig: {\n   }\n }\n\n\nWe have migrated VuePress's documentation to VT at #21 with super minimal code changes, you can preview at vuepress-docs.vercel.app.\n\n\n# Migrate from other themes\n\nFirst, you need to make sure you are not overly relying on the theme's features. Second, you can migrate based on Getting Started > Manual Installation, if you encounter any issues or features that need to be added, feel free to submit an issue or pull request.",
      "normalizedContent": "# migration\n\n\n# migrate from default theme\n\nsince vt is fully compatible with vuepress's default theme, migrating from default theme to vt is very easy:\n\n // .vuepress/config.js\n module.exports = {\n+  theme: 'vt',\n   themeconfig: {\n   }\n }\n\n\nwe have migrated vuepress's documentation to vt at #21 with super minimal code changes, you can preview at vuepress-docs.vercel.app.\n\n\n# migrate from other themes\n\nfirst, you need to make sure you are not overly relying on the theme's features. second, you can migrate based on getting started > manual installation, if you encounter any issues or features that need to be added, feel free to submit an issue or pull request.",
